import './UserInputBox.css'
import { useSelector,useDispatch } from 'react-redux'


export const CustomTip =()=>{
    const dispatch  = useDispatch()

    const customTipHandler =()=>{

        dispatch({type:'set-custom-tip',percentamount:0});

    }

    return(
        <div className="container-custom">      
        <input className='container-child' onChange={()=>customTipHandler()} required value= {0} type="number"></input>
        </div>
    )
}
